import {
  mdiAccountCircle,
  mdiDesktopMac,
  mdiLock,
  mdiSquareEditOutline,
  mdiTable,
  mdiTelevisionGuide,
  mdiResponsive,
} from "@mdi/js";

export default [
  "General",
  [
    {
      to: "/",
      icon: mdiDesktopMac,
      label: "Dashboard",
    },
  ],
  "Examples",
  [
    {
      to: "/tables",
      label: "Tables",
      icon: mdiTable,
      updateMark: true,
    },
    {
      to: "/forms",
      label: "Forms",
      icon: mdiSquareEditOutline,
    },
    {
      to: "/ui",
      label: "UI",
      icon: mdiTelevisionGuide,
    },
    {
      to: "/responsive",
      label: "Responsive",
      icon: mdiResponsive,
    },
    {
      to: "/profile",
      label: "Profile",
      icon: mdiAccountCircle,
    },
    {
      to: "/login",
      label: "Login",
      icon: mdiLock,
    },
  ],
];

